import React from 'react';

function App() {
    return (
        <div>
            <h1>My Tableau Dashboard</h1>
            <iframe
                src="https://public.tableau.com/app/profile/sudarshan.chikkathimmaiah/viz/SanJoseCrashesData/Dashboard1"
                width="100%"
                height="800px"
                frameBorder="0"
            ></iframe>
        </div>
    );
}

export default App;
